import React from 'react';
import { NavLink } from 'react-router-dom';
import { Brain } from 'lucide-react';

const Footer = () => (
  <footer className="px-8 py-16 bg-gray-900 text-white">
    <div className="grid grid-cols-4 gap-8 max-w-7xl mx-auto">
      <div>
        <div className="flex items-center space-x-2 mb-4">
          <Brain className="w-8 h-8 text-primary" />
          <NavLink to="/" className="text-xl font-semibold hover:text-white">
            ClinicalAI
          </NavLink>
        </div>
        <p className="text-neutral">
          Accelerating clinical trials through artificial intelligence and machine learning.
        </p>
      </div>
      <div>
        <h4 className="mb-4 text-lg font-semibold">Quick Links</h4>
        <ul className="space-y-2 text-neutral">
          <li>
            <NavLink
              to="/solutions"
              className={({ isActive }) =>
                isActive ? 'text-white' : 'hover:text-white cursor-pointer'
              }
            >
              Solutions
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/case-studies"
              className={({ isActive }) =>
                isActive ? 'text-white' : 'hover:text-white cursor-pointer'
              }
            >
              Case Studies
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/about"
              className={({ isActive }) =>
                isActive ? 'text-white' : 'hover:text-white cursor-pointer'
              }
            >
              About Us
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/careers"
              className={({ isActive }) =>
                isActive ? 'text-white' : 'hover:text-white cursor-pointer'
              }
            >
              Careers
            </NavLink>
          </li>
        </ul>
      </div>
      <div>
        <h4 className="mb-4 text-lg font-semibold">Resources</h4>
        <ul className="space-y-2 text-neutral">
          <li>
            <NavLink
              to="/blog"
              className={({ isActive }) =>
                isActive ? 'text-white' : 'hover:text-white cursor-pointer'
              }
            >
              Blog
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/documentation"
              className={({ isActive }) =>
                isActive ? 'text-white' : 'hover:text-white cursor-pointer'
              }
            >
              Documentation
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/research-papers"
              className={({ isActive }) =>
                isActive ? 'text-white' : 'hover:text-white cursor-pointer'
              }
            >
              Research Papers
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/compliance"
              className={({ isActive }) =>
                isActive ? 'text-white' : 'hover:text-white cursor-pointer'
              }
            >
              Compliance
            </NavLink>
          </li>
        </ul>
      </div>
      <div>
        <h4 className="mb-4 text-lg font-semibold">Contact</h4>
        <ul className="space-y-2 text-neutral">
          <li>contact@clinicalai.com</li>
          <li>+1 (555) 234-5678</li>
          <li>Boston, MA</li>
        </ul>
      </div>
    </div>
    <div className="mt-16 pt-8 border-t border-gray-800 text-center text-neutral">
      © 2025 ClinicalAI. All rights reserved.
    </div>
  </footer>
);

export default Footer;
